import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import Mainpage from "../views/Mainpage";
import { Homepage } from "../views/Homepage";
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import { createMaterialBottomTabNavigator } from "@react-navigation/material-bottom-tabs";

import { creae } from "@react-navigation/material-bottom-tabs";
import { Certificates } from "../views/Certificates";
import VerifyFloatingButton from "../assets/VerifyFloatingButton";
import BarcodeScanner from "../assets/BarcodeScanner";
import TabBarHomeIcon from "../assets/TabBarIcon";
import { navigationRef } from "./RootNavigation";
import { AccountInfo } from "../views/AccountInfo";

const BottomTab = createMaterialBottomTabNavigator();

function MyBottomTabs() {
  return (
    <NavigationContainer ref={navigationRef}>
      <BottomTab.Navigator>
        <BottomTab.Screen
          options={{
            tabBarIcon: ({ focused }) => (
              <TabBarHomeIcon
                focused={focused}
                name={Platform.OS === "ios" ? `ios-home` : "md-home"}
              />
            ),
          }}
          name="Mainpage"
          component={Mainpage}
        />
        <BottomTab.Screen
          name="Certificates"
          options={{
            tabBarIcon: ({ focused }) => (
              <TabBarHomeIcon
                focused={focused}
                name={Platform.OS === "ios" ? `md-wallet` : "md-wallet"}
              />
            ),
          }}
          component={Certificates}
        />
        <BottomTab.Screen
          name="Account"
          options={{
            tabBarIcon: ({ focused }) => (
              <TabBarHomeIcon
                focused={focused}
                name={Platform.OS === "ios" ? `md-person` : "md-person"}
              />
            ),
          }}
          component={AccountInfo}
        />
      </BottomTab.Navigator>
    </NavigationContainer>
  );
}
export default MyBottomTabs;

const Tab = createMaterialTopTabNavigator();

function MyTabs() {
  return (
    <NavigationContainer ref={navigationRef}>
      <Tab.Navigator
        tabBarOptions={{ style: { backgroundColor: "powderblue" } }}
      >
        <Tab.Screen name="Mainpage" component={Mainpage} />
        <Tab.Screen name="Certificates" component={Certificates} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

